import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import pokedexJSON from './pokedex.json';
import Pokemon from './pokemon.js';
import PokeCard from './poke-card.js';

import TextField from '@material-ui/core/TextField';

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      pokedex: this.loadPokeDex(),
      poke_view: []
    }
  }

  loadPokeDex = () => {
    var dex = [];
    for (var pokemonIndex in pokedexJSON) {
      var pokemonJSON = pokedexJSON[pokemonIndex];
      const pokemon = new Pokemon(
        pokemonJSON['id'],
        pokemonJSON['ename']
      );
      dex.push(pokemon);
    }
    return dex;
  }

  render() {
    console.log(this.state.pokedex);
    return (
      <div className="App">
        <TextField
          label='pokemon'
          fullWidth
        />
        for (const pokemon in this.state.pokedex)
        <PokeCard
          pokemon={this.state.pokedex[0]}
        />
      </div>
    );
  }
}

export default App;
